import { React } from 'react';

/**
 * Match History Component
 * 
 * @author Ben Kelly w19014367
 */

export default function MatchHistory({ playerProfile }) {


    return(
        <div className='matchHistory-contents'>
            <p><strong>Games: </strong></p>
            <p><strong>Wins: </strong></p>
            <p><strong>Draws: </strong></p>
            <p><strong>Losses: </strong></p>
            <p><strong>Goals: </strong></p>
            <p><strong>Assists: </strong></p>
            <p><strong>Avg Rating: </strong></p>
        </div>
    )

}
